const News = () => {
    return (
    <div>
        <div>
            <div id="Top-title"></div>
        </div>

    <div id="news"></div>


    <div class="see-more">
        <button id="seeMoreBtn">See More</button>
    </div>

    </div>
    );
};

export default News;
